PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE resume (
	id INTEGER NOT NULL, 
	full_name VARCHAR, 
	email VARCHAR, 
	phone VARCHAR, 
	resume_file VARCHAR, 
	position_applied VARCHAR, 
	application_date DATETIME, 
	test_score FLOAT, 
	test_url VARCHAR, 
	interview_status VARCHAR(13), 
	interview_date DATETIME, 
	application_status VARCHAR(9), 
	recruiter_notes VARCHAR, 
	hr_notes VARCHAR, 
	technical_notes VARCHAR, 
	years_experience INTEGER, 
	skills VARCHAR, 
	source VARCHAR, 
	source_id VARCHAR, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
COMMIT;
